var Quality=[{name:["Battle-Scarred","Закалённое в боях"],chance:50},{name:["Well-Worn","Поношенное"],chance:40},{name:["Field-Tested","После полевых испытаний"],chance:30},{name:["Minimal Wear","Немного поношенное"],chance:20},{name:["Factory New","Прямо с завода"],chance:10}];function getQualityName(a,d){var c=0;if(typeof d=="undefined"){d="EN"}if(d=="RU"){c=1}var b=Quality.filter(function(e){return e.name.indexOf(a)!=-1});if(b.length!=0){return b[0].name[c]}else{console.error("Wrong quality! '"+a+"'");return"Wrong quality name"}}function getItemQuality(){var b=0;var e=0;var c=Math.random();for(var a=0;a<Quality.length;a++){b+=Quality[a].chance}for(var a=0;a<Quality.length;a++){var d=Quality[a].chance/b;Quality[a].weight=d}for(var a=0;a<Quality.length;a++){e+=Quality[a].weight}var f=0;for(var a=0;a<Quality.length;a++){f+=Quality[a].weight/e;if(f>=c){return Quality[a].name}}}function ifStatTrak(b,a){b=b||"";a=a||"";if(b!=""){if(b.indexOf("Сувенир")!=-1){return false}if(b.indexOf("Souvenir")!=-1){return false}}if(b!=""&&a!=""){col=getCollection(b,a);if(col!=""&&col.type=="Collection"){return false}}return(random=Math.random()>0.8)?true:false};